import Button from "../Button/Button";

export default function HeroBanner(props) {
    const HeroBanner = "banner" + (props.className ? `${props.className}` : '');
    const HeroTitle = props.title ? `${props.title}` : '';
    const HeroSubTitle = props.subTitle ? `${props.subTitle}` : '';

    return (
        <>
            <div className={HeroBanner}>
                <h1>{HeroTitle}</h1>
                <p>{HeroSubTitle}</p>
                <Button type="button" className="btn-primary">Explore Now</Button>
            </div>
        </>
    )
}
